INSERT INTO Contract (`contract_id`, `contract_type`, `contract_terms`, `start_date`, `end_date`, `revenue_share`, `artist_id`, `performance_id`) VALUES
('1', 'Casual', 'Molestia perfruique maximis et animi et molestiam dolor afferat, eorum tamen utrumque et ortum esse e corpore et ad usus.', '2024-09-03', '2024-07-22', '51.60', '12', '26'),
('2', 'Part-Time', 'Illae Epicuri propriae ruinae: censet enim eadem illa constituto veri a falso distinctio.', '2025-03-29', '2024-10-22', '43.57', '7', '19'),
('3', 'Temporary', 'Omnem perturbari videmus errore et inscientia, sapientiamque esse solam, quae nos exhorrescere metu non sinat. Qua praeceptrice in tranquillitate vivi potest omnium cupiditatum ardore restincto. Cupiditates enim sunt insatiabiles, quae.', '2024-08-02', '2024-09-05', '37.10', '6', '38'),
('4', 'Contract', 'Nulli satis eruditi videntur, quibus nostra ignota sunt. An ''Utinam ne in nemore . .', '2024-10-20', '2024-05-28', '41.78', '28', '25'),
('5', 'Freelance', 'Mortis metu, non conturbamur ignoratione rerum, e qua ipsa horribiles existunt saepe formidines. Denique etiam morati melius erimus, cum didicerimus quid natura desideret. Tum vero, si stabilem scientiam rerum tenebimus, servata illa, quae quasi delapsa de caelo est ad quiete vivendum, caritatem, praesertim cum omnino nulla sit causa peccandi. Quae enim cupiditates a natura proficiscuntur, facile.', '2024-11-13', '2024-08-23', '53.73', '32', '16'),
('6', 'Freelance', 'Reprehensiones incurreret. Nam quibusdam, et iis servire, qui vel utrisque litteris uti velint vel, si suas habent, illas.', '2024-08-22', '2025-02-23', '55.19', '38', '22'),
('7', 'Contract', 'Si canes, si equos, si ludicra exercendi aut venandi consuetudine adamare solemus, quanto id.', '2025-01-06', '2025-01-28', '43.42', '15', '5'),
('8', 'Contract', 'Voluptaria, delicata, mollis habeatur disciplina, quam gravis, quam continens, quam severa sit. Non enim hanc solam sequimur, quae suavitate aliqua naturam ipsam movet et cum iucunditate quadam percipitur sensibus, sed maximam voluptatem illam habemus, quae percipitur omni dolore et molestia perfruique maximis et animi et molestiam dolor afferat, eorum tamen utrumque et ortum esse e corpore.', '2024-04-15', '2024-04-16', '55.61', '21', '8'),
('9', 'Contract', 'Autem, qui dicant foedus esse quoddam sapientium, ut ne minus amicos quam se ipsos penitus perdiderunt, sic robustus animus et excelsus omni est liber cura et angore, cum.', '2024-10-06', '2024-06-20', '42.98', '19', '3'),
('10', 'Freelance', 'Ratione intellegi posse et voluptatem pleniorem efficit. Itaque non ob ea solum incommoda, quae eveniunt inprobis, fugiendam inprobitatem putamus, sed multo magis vita et factis et moribus comprobavit. Quod quam magnum sit fictae.', '2025-03-13', '2025-03-24', '52.04', '37', '11'),
('11', 'Part-Time', 'Praestabiliorem aut magis expetendum possimus dicere? Inesse enim necesse est aut in poetis evolvendis.', '2024-09-04', '2025-03-01', '43.62', '11', '2'),
('12', 'Temporary', 'Ratione dici non necesse est. Tribus igitur modis video esse a nostris de amicitia dicenda sunt. Praeclare enim Epicurus his paene verbis: ''Eadem'', inquit, ''scientia confirmavit animum, ne quod aut sempiternum aut diuturnum timeret malum, quae perspexit in hoc ipso vitae spatio amicitiae praesidium.', '2024-09-04', '2024-07-26', '43.62', '33', '34'),
('13', 'Contract', 'Ipsam amicitiam tueri, nisi aeque amicos et nosmet ipsos diligamus, idcirco et hoc ipsum efficitur in amicitia, et amicitia cum voluptate vivatur. Quoniam autem id est vel summum bonorum vel ultimum vel extremum -- quod et scripta multa sunt, sic inprobitas si cuius in.', '2024-10-29', '2025-03-10', '52.66', '3', '15'),
('14', 'Full-Time', 'Debitis aut rerum necessitatibus saepe eveniet, ut et.', '2024-06-24', '2025-02-01', '54.73', '4', '30'),
('15', 'Freelance', 'Arbitrarer, plura suscepi veritus ne movere hominum studia viderer, retinere non posse. Qui autem, si maxime hoc placeat, moderatius tamen id confidet fore semper occultum. Plerumque improborum facta primo suspicio insequitur, dein sermo atque fama, tum accusator, tum iudex; Multi etiam, ut te consule, ipsi se indicaverunt. Quodsi qui satis sibi contra.', '2024-06-07', '2024-11-18', '58.33', '29', '36'),
('16', 'Seasonal', 'Vellem, censes haec dicturum fuisse? Utrum igitur percurri omnem Epicuri.', '2024-08-31', '2025-03-01', '56.89', '9', '4'),
('17', 'Casual', 'Illa, fruitur praesentibus ab iisque M. Brutus dissentiet -- quod Graeci telos nominant --, quod ipsum nullam ad aliam rem, ad id omnia referri oporteat, ipsum autem nusquam. Hoc Epicurus in voluptate esse aut in armatum hostem impetum fecisse aut in armatum hostem impetum fecisse aut in poetis evolvendis, ut ego et Triarius te hortatore facimus.', '2024-10-06', '2024-10-04', '61.48', '23', '17'),
('18', 'Part-Time', 'Laetamur iis, quae et splendide dicta sint neque sint conversa de Graecis? Nam si concederetur, etiamsi ad corpus referri, nec ob eam causam non fuisse. -- Torquem detraxit hosti. -- Et quidem se texit, ne interiret. -- At magnum periculum adiit. -- In oculis quidem exercitus. -- Quid.', '2024-06-04', '2024-07-08', '46.12', '35', '18'),
('19', 'Internship', 'Cum mihi nihil sane praeter sedulitatem probarent, omnes mihi Epicuri sententiae satis notae.', '2024-06-19', '2024-07-14', '53.40', '17', '9'),
('20', 'Part-Time', 'Beateque vivendo a Platone disputata sunt, haec explicari non placebit Latine? Quid? Si nos non interpretum fungimur munere, sed tuemur ea, quae sensum moveat, nulla successerit, eoque intellegi potest quanta voluptas sit non dolere. Sed ut iis bonis erigimur, quae expectamus, sic laetamur iis.', '2024-08-06', '2025-02-07', '51.57', '27', '1'),
('21', 'Temporary', 'Ipsa mihi sunt voluptati, et erant illa Torquatis.'' Numquam hoc ita defendit Epicurus neque Metrodorus aut quisquam eorum, qui aut.', '2025-03-24', '2024-10-05', '44.98', '8', '39'),
('22', 'Freelance', 'Sentiant non esse faciendum, ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem etiam dolorem saepe perpetiuntur, ne, si id non faciant, incidant in maiorem. Ex quo efficiantur.', '2025-01-22', '2024-05-24', '37.14', '39', '12'),
('23', 'Full-Time', 'Quid sit extremum et ultimum bonorum, quod omnium.', '2024-11-19', '2025-02-03', '44.77', '13', '27'),
('24', 'Temporary', 'Ut enim ad minima veniam, quis nostrud exercitation ullamco laboris nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit, qui in ea voluptate.', '2024-05-02', '2024-05-15', '58.55', '5', '21'),
('25', 'Full-Time', 'Transferre in voluptatem, ut ea maior sit, si nihil tale metuamus. Iam illud quidem physici, credere aliquid esse minimum, quod profecto numquam putavisset, si a Polyaeno, familiari suo, geometrica discere maluisset quam illum etiam ipsum dedocere. Sol Democrito magnus videtur, quippe homini erudito in geometriaque perfecto, huic pedalis fortasse; tantum enim esse censet, quantus videtur, vel.', '2024-11-26', '2024-04-28', '53.87', '31', '13'),
('26', 'Casual', 'Putet eius esse dignitatis, quam mihi quisque tribuat, quid in omni munere vitae optimum et verissimum sit, exquirere? An, partus ancillae sitne in fructu habendus, disseretur inter principes civitatis, P.', '2024-12-02', '2025-02-28', '53.40', '10', '20'),
('27', 'Contract', 'Certe nihil homini possit melius esse quam vacare omni dolore careret, non modo non inopem, ut vulgo putarent, sed locupletiorem etiam esse quam Graecam. Quando enim nobis, vel dicam aut oratoribus bonis aut poetis, postea quidem quam fuit quem.', '2025-02-24', '2024-09-17', '54.21', '34', '6'),
('28', 'Temporary', 'Esse fugiendam? Eademque ratione ne temperantiam quidem propter se expetendam esse dicemus, sed.', '2024-09-07', '2024-07-13', '51.40', '16', '40'),
('29', 'Full-Time', 'Quo efficeretur mundus omnesque partes mundi, quaeque in eo filio adhibuit, quem in adoptionem D. Silano emancipaverat, ut eum Macedonum.', '2024-05-06', '2024-07-09', '38.03', '40', '7'),
('30', 'Contract', 'Ad extremum etiam indoctum fuisse. Fieri, inquam, Triari, nullo pacto potest, ut propemodum iustioribus utamur illis, qui omnino avocent a philosophia, quam his, qui rebus infinitis modum constituant.', '2025-03-31', '2024-04-24', '43.31', '20', '24'),
('31', 'Freelance', 'Explicatis, et, ut modo docui, cognitionis regula et iudicio ab eadem illa individua et solida corpora ferri deorsum suo pondere ad lineam, hunc naturalem esse omnium corporum motum. Deinde ibidem homo acutus, cum illud ocurreret, si omnia deorsus e regione inferiorem locum petentium sine causa eripuit atomis nec.', '2024-07-20', '2024-10-24', '60.57', '18', '29'),
('32', 'Seasonal', 'Iudicio ab eadem illa atomorum, in quo etiam.', '2024-08-05', '2025-02-04', '54.89', '36', '10'),
('33', 'Full-Time', 'Et perinde fructuosam relinqueret? Non ergo Epicurus ineruditus, sed ii indocti, qui, quae pueros non didicisse turpe est, ea putant usque ad senectutem esse discenda. Quae.', '2024-10-05', '2024-05-03', '53.52', '26', '14'),
('34', 'Casual', 'Sit a dolore corporis praesenti futurove seiunctum. Nec vero quisquam stultus non horum morborum aliquo laborat, nemo igitur est difficilius.', '2024-10-21', '2024-08-30', '51.39', '2', '28'),
('35', 'Freelance', 'Praeterea neque praesenti nec expectata voluptate, quid eo miserius dici aut fingi potest? Quodsi vita doloribus referta maxime fugienda est, summum profecto malum est vivere cum dolore, cui sententiae consentaneum est ultimum esse bonorum voluptatem ex hoc percipiatur, quod videamus esse finitum. In dialectica autem vestra nullam existimavit esse nec ad commodius disserendum viam. In physicis.', '2025-01-02', '2024-07-17', '59.93', '14', '32'),
('36', 'Full-Time', 'Etiam videtur multis voluptatibus, cum ipsi naturae patrioque amori praetulerit ius maiestatis atque imperii. Quid? T. Torquatus, is qui consul cum Cn. Octavio fuit, cum illam severitatem in eo essent. Quae cum.', '2024-05-15', '2024-07-19', '38.28', '24', '35'),
('37', 'Seasonal', 'Autem usus progrediens familiaritatem effecerit, tum amorem efflorescere tantum, ut.', '2024-12-04', '2025-01-05', '40.74', '25', '33'),
('38', 'Freelance', 'Quae perspexit in hoc ipso vitae spatio amicitiae praesidium esse firmissimum.'' Sunt autem quidam Epicurei timidiores paulo contra vestra convicia, sed tamen satis acuti, qui verentur ne, si id non faciant, incidant in maiorem. Ex quo efficiantur ea, quae.', '2024-05-13', '2024-06-14', '50.75', '22', '37'),
('39', 'Casual', 'Poterit et iustius? Sunt autem, qui dicant.', '2024-04-23', '2024-06-06', '44.89', '1', '23'),
('40', 'Internship', 'Se isdem Euripidis fabulis delectari dicat, Latinas litteras oderit? Synephebos ego, inquit.', '2024-11-25', '2024-08-18', '48.97', '30', '31'),
('41', 'Casual', 'Potione fames sitisque depulsa est, ipsa detractio molestiae consecutionem affert voluptatis, sic in omni.', '2024-10-15', '2025-02-05', '42.32', '22', '39'),
('42', 'Contract', 'Cum tractat locos ab Aristotele ante tractatos? Quid? Epicurei num desistunt de isdem, de quibus et ab antiquis, ad arbitrium suum scribere? Quodsi Graeci leguntur a Graecis isdem de rebus alia ratione compositis, quid est, cur nostri a nostris de.', '2025-01-16', '2024-09-25', '47.80', '20', '10'),
('43', 'Contract', 'Dolore magnam aliquam quaerat voluptatem. Ut enim aeque doleamus animo, cum corpore dolemus, fieri tamen permagna accessio potest, si aliquod aeternum et.', '2024-04-25', '2025-03-18', '44.80', '3', '19'),
('44', 'Internship', 'Laetitia aeque atque nostra et pariter dolemus angoribus. Quocirca eodem modo sapiens erit affectus erga amicum, quo in se ipsum.', '2024-06-10', '2024-07-11', '37.04', '31', '34'),
('45', 'Casual', 'Quod fit etiam nunc ab Epicureis. Sed ad.', '2024-09-22', '2025-03-30', '38.35', '32', '5'),
('46', 'Seasonal', 'Affecta, quem ad me de virtute misisti. Sed ex eo est consecutus? -- Laudem et caritatem, quae sunt vitae sine metu.', '2024-07-27', '2025-02-01', '38.79', '39', '20'),
('47', 'Freelance', 'Est finibus bonorum et malorum fere a nobis philosophia defensa et collaudata est, cum esset accusata et vituperata ab Hortensio. Qui liber cum et mortem contemnit, qua qui utuntur, benivolentiam sibi conciliant et, quod aptissimum est ad quiete vivendum, caritatem.', '2025-03-29', '2025-04-03', '58.99', '4', '36'),
('48', 'Part-Time', 'Rutilius multo etiam magis, quorum ille iudicium.', '2024-05-04', '2025-03-09', '54.03', '1', '6'),
('49', 'Internship', '. . .'' nihilo minus legimus quam hoc idem Graecum, quae autem.', '2024-10-15', '2024-11-06', '37.90', '21', '16'),
('50', 'Seasonal', 'Quia pacem animis afferat et eos quasi concordia quadam placet ac leniat. Temperantia est enim, quae in rebus aut expetendis aut fugiendis ut rationem sequamur monet. Nec enim satis est iudicare quid faciendum non faciendumve sit, sed stare etiam oportet.', '2024-05-20', '2024-07-12', '37.29', '26', '29'),
('51', 'Full-Time', 'Platone disputata sunt, haec explicari non placebit Latine? Quid? Si nos non interpretum fungimur munere, sed tuemur ea.', '2024-06-20', '2024-05-17', '49.10', '13', '26'),
('52', 'Temporary', 'Mi Albucius, hinc inimicus. Sed iure Mucius. Ego autem mirari satis non queo unde.', '2024-08-27', '2024-11-09', '49.98', '5', '14'),
('53', 'Contract', 'Possumus, animo autem et praeterita grate.', '2024-07-26', '2025-02-02', '52.87', '18', '30'),
('54', 'Seasonal', 'Ultima antiquitate repetitis tria vix amicorum paria reperiuntur, ut ad id omnia referri oporteat, ipsum autem nusquam. Hoc Epicurus in voluptate ponit.', '2024-05-08', '2024-08-28', '60.29', '6', '2'),
('55', 'Full-Time', 'Physicis plurimum posuit. Ea scientia et.', '2024-11-15', '2024-08-22', '58.35', '17', '15'),
('56', 'Seasonal', 'Arbitraretur? Ut enim mortis metu omnis quietae vitae status perturbatur, et ut succumbere doloribus eosque humili animo inbecilloque ferre miserum est, ob.', '2025-03-24', '2024-04-19', '48.99', '11', '32'),
('57', 'Seasonal', 'Neque pecuniae modus est ullus investigandi.', '2024-09-20', '2024-06-25', '40.49', '27', '33'),
('58', 'Full-Time', 'Atomorum et magnitudinem solis probabo et Democriti errata ab Epicuro sapiens semper beatus inducitur: finitas habet cupiditates, neglegit mortem, de diis inmortalibus supplicii causa importari putant. Quae autem tanta ex improbis factis ad minuendas vitae molestias accessio potest fieri.', '2024-11-05', '2024-11-21', '49.94', '29', '21'),
('59', 'Full-Time', 'Et cognitio rerum, quod minime ille vult expetenda. Haec igitur Epicuri non probo, tum illud in primis, quod, cum in rerum natura cognita levamur superstitione, liberamur mortis metu, non conturbamur ignoratione rerum, e qua ipsa horribiles existunt saepe formidines. Denique etiam morati.', '2024-07-26', '2025-02-22', '41.55', '38', '13'),
('60', 'Contract', 'Voluptate. Idem etiam dolorem saepe perpetiuntur, ne, si id non faciant, incidant in maiorem. Ex quo efficeretur mundus omnesque partes mundi, quaeque in eo filio adhibuit, quem in adoptionem D. Silano emancipaverat, ut eum Macedonum legatis accusantibus, quod pecunias praetorem in provincia cepisse arguerent, causam apud se dicere iuberet reque ex utraque.', '2025-02-25', '2024-04-15', '54.52', '28', '3'),
('61', 'Seasonal', 'Inter mediocrem animadversionem atque admonitionem. Altera occulta quaedam et quasi involuta aperiri, altera prompta et aperta iudicari. Etenim quoniam detractis de homine sensibus reliqui nihil est, necesse est, quid aut ad bene beateque vivendo a Platone disputata sunt, haec explicari non placebit Latine? Quid? Si nos non interpretum.', '2024-07-23', '2024-12-24', '58.99', '35', '4'),
('62', 'Contract', 'Legam? A quibus tantum dissentio, ut, cum Sophocles vel optime scripserit Electram, tamen male conversam Atilii mihi legendam putem, de quo quaerimus, non quo modo efficiatur concludaturque ratio tradit, non qua via captiosa solvantur ambigua distinguantur ostendit; iudicia rerum.', '2025-03-25', '2024-12-31', '40.66', '40', '23'),
('63', 'Internship', 'Etiam, quem optimus quisque pro patria et pro suis suscipit, ut non dicas, quid non probes eius, a quo dissentias. Quid enim me prohiberet Epicureum esse, si.', '2024-09-29', '2024-11-13', '43.55', '2', '22'),
('64', 'Contract', 'Accusator, tum iudex; Multi etiam, ut te consule, ipsi se indicaverunt. Quodsi qui satis.', '2024-12-12', '2024-10-18', '40.65', '37', '18'),
('65', 'Seasonal', 'Placet, nihil dolere, primum tibi recte, Chrysippe, concessum est nihil desiderare manum, cum ita sit, perspicuum est nihil ad iucunde vivendum reperiri posse, quod coniunctione tali sit aptius. Quibus ex.', '2024-07-10', '2025-04-04', '57.33', '33', '9'),
('66', 'Temporary', 'Ipsum autem nusquam. Hoc Epicurus in voluptate ponatur, sed sine hoc institutionem omnino amicitiae non posse reperiri. Quapropter si ea.', '2024-04-13', '2024-05-16', '57.89', '30', '17'),
('67', 'Internship', 'Tam inimicus paene nomini Romano est, qui Ennii Medeam aut Antiopam Pacuvii spernat aut reiciat, quod se isdem Euripidis fabulis delectari dicat, Latinas litteras oderit? Synephebos ego, inquit, potius Caecilii aut Andriam Terentii quam utramque Menandri legam? A quibus.', '2024-04-27', '2024-07-04', '38.89', '10', '12'),
('68', 'Full-Time', 'Errore naturae finibus contentus sine aegritudine possit et sine metu degendae praesidia firmissima. -- Filium morte multavit. .', '2024-07-20', '2024-11-24', '56.25', '24', '35'),
('69', 'Part-Time', 'Sed hoc commune vitium, illae Epicuri propriae ruinae: censet enim eadem illa atomorum, in quo a nobis sic intelleges eitam, ut ab Homero Ennius, Afranius a Menandro solet. Nec vero, ut noster Lucilius, recusabo, quo minus id, quod ipsi statuerunt, non possunt.', '2025-03-22', '2024-12-23', '47.97', '23', '24'),
('70', 'Casual', 'Nec expectata voluptate, quid eo miserius dici aut fingi potest? Quodsi.', '2024-07-16', '2024-08-12', '48.31', '36', '40'),
('71', 'Part-Time', 'Nihil posset fieri minus; ita effici complexiones et copulationes et adhaesiones atomorum.', '2024-05-25', '2025-01-14', '44.47', '9', '31'),
('72', 'Casual', 'Sed de clarorum hominum factis illustribus et gloriosis satis hoc loco dictum sit. Erit.', '2024-09-26', '2024-08-18', '37.89', '16', '7'),
('73', 'Full-Time', 'Corporis praesenti futurove seiunctum. Nec vero quisquam stultus non horum morborum aliquo laborat, nemo igitur est difficilius satis facere, qui se dicant in Graecis legendis operam malle consumere.', '2025-01-24', '2024-04-23', '42.22', '8', '38'),
('74', 'Temporary', 'Sed contra semper afficit cum vi sua atque natura, quod tranquillat animos.', '2024-10-31', '2025-03-19', '50.37', '12', '27'),
('75', 'Casual', 'Erunt, ut Epicuri ratio docet, tum denique poterit aliquid cognosci.', '2024-10-21', '2024-09-10', '58.04', '7', '25');
